import { format } from 'date-fns-tz';
import ptBR from 'date-fns/locale/pt-BR/index';

import crypto from 'crypto';

export function calculateAge(birthday) {
  var ageDifMs = Date.now() - birthday.getTime();
  var ageDate = new Date(ageDifMs); // miliseconds from epoch
  var age = Math.abs(ageDate.getUTCFullYear() - 1970);

  return age > 100 ? null : age;
}

export const formatDate = (data) => {
  let date = new Date(data),
    dia = date.getDate().toString().padStart(2, '0'),
    mes = (date.getMonth() + 1).toString().padStart(2, '0'),
    ano = date.getFullYear();

  return `${dia}/${mes}/${ano}`;
};

export const hexToRgb = (hex) => {
  var result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
  return result
    ? {
        r: parseInt(result[1], 16),
        g: parseInt(result[2], 16),
        b: parseInt(result[3], 16),
      }
    : null;
};

export const convertHHMMSSToMinutes = (date) => {
  if (date) {
    var a = date.split(':');
    var minutes = +a[0] * 60 + +a[1];
    return minutes;
  }

  return '';
};

export const formatStringDate = (date) => {
  if (date) {
    var dia = date.split('/')[0];
    var mes = date.split('/')[1];
    var ano = date.split('/')[2];

    return ano + '-' + ('0' + mes).slice(-2) + '-' + ('0' + dia).slice(-2);
  }
};

export const conversionPixelToRem = (pixels) => {
  return 0.0625 * pixels;
};

export const formatToMinutes = (number) => {
  const minutes = Math.floor(number / 60);
  const seconds = number - minutes * 60;

  return `00:${('00' + minutes).slice(-2)}:${('00' + seconds).slice(-2)}`;
};

export const uuidv4 = () => {
  return (<any>[1e7] + -1e3 + -4e3 + -8e3 + -1e11).replace(/[018]/g, (c) =>
    (
      c ^
      (crypto.getRandomValues(new Uint8Array(1))[0] & (15 >> (c / 4)))
    ).toString(16)
  );
};

export const calculatePagesCount = (pageSize, totalCount) => {
  return totalCount < pageSize ? 1 : Math.ceil(totalCount / pageSize);
};

export const formatIsoDateExtenso = (ISODate) => {
  if (ISODate) {
    const dt = new Date(ISODate ? ISODate : null);
    const date = format(
      new Date(dt.valueOf() + dt.getTimezoneOffset() * 60 * 1000),
      'dd MMM',
      {
        locale: ptBR,
      }
    );
    return date;
  }

  return null;
};

export const favoritesAdsAdapter = (ads) => {
  const newArray = ads.map((ad) => {
    const array = [];

    array.push(ad.thumbnail);

    ad.photos = array;

    return ad;
  });

  return newArray;
};

export const formatBase64 = (base64) => {
  return base64
    ?.replace('data:image/jpeg;base64,', '')
    .replace('data:image/png;base64,', '');
};

export const imageBuyDefault = () => {
  return '';
};
